INSERT INTO `blog` (`id`, `b_heading`, `b_content`, `b_date`, `image`) VALUES
(5, 'We donâ€™t have a health systemâ€™: Expert on prisons, race, and COVID-19', 'According to some of the most recent data, Black Americans are 2.4 times more likely to die of COVID-19 than their white counterparts, and 2.2 times as likely as Asian Americans and Latin Americans. Other studies have also suggested that Black communities, followed by Latinx communities, are being hit the hardest by the pandemic.\r\n\r\nThrough a series of Special Features and interviews, Medical News Today have been trying to untangle some of the mechanisms behind these racial disparities. \r\n\r\nIn our previous interview on COVID-19 race-related health inequalities, Prof. Tiffany Green quoted the work of John Eason, Ph.D., associate professor in the department of sociology at the University of Wisconsin-Madison â€” to point out one such potential mechanism.\r\n\r\nProf. Easonâ€™s ongoing research shows that Black and Latinx people are overrepresented as corrections officers in county jails and suggests that these workers may be inadvertently spreading the new coronavirus.\r\n\r\nIn this interview, MNT has followed up on this issue by speaking to Prof. Eason himself about his research.\r\n\r\nProf. Easonâ€™s expertise focuses on imprisonment, healthcare access, and health disparities across the rural-urban continuum. He is also the director of the University of Wisconsin-Madison Justice Lab. \r\n\r\nWe have lightly edited the interview transcript for clarity.\r\n\r\nMNT: Can you tell us about the role that incarceration plays in the uneven effect that COVID-19 is having on Black and Latinx communities? Your research suggests that a disproportionate number of corrections officers may inadvertently serve as SARS-CoV-2 vectors in these communities, could you kindly expand on that? \r\n\r\nProf. Eason: Weâ€™ve paid a lot of attention to the disproportionate rate of incarceration for Black and Latinx people in the U.S. â€” itâ€™s more so for Black people. So, while over 60% of Americans know someone or have a family member in prison, itâ€™s more like 90% for African Americans, so the scale of mass incarceration is unprecedented. \r\n\r\nWhatâ€™s also quite unprecedented in the U.S. compared to any other country is prison building, or what Iâ€™ve labeled as the â€œprison boom,â€ where we built over 1,100 prisons [â€¦] in about 35 years, and weâ€™ve expanded the footprint [of these facilities].\r\n\r\nJust the landmass is more than 600 square miles in terms of the number of prisons and how big they are.\r\n\r\nIn that expansion, weâ€™ve grown to now 450,000 corrections officers, and in the last major study done on this, we saw Black folks, more than Latinx, being overrepresented in the corrections officers [â€¦] labor force. Black folks were nearly double, 22 or 23% of corrections officers were Black while only 11% were Latinx.\r\n\r\nThereâ€™s also a lot of conjecture and a lack of understanding about the empirical reality of where prisons are built. \r\n\r\nMy research has shown that while we think that these are overwhelmingly white towns, the average town that gets a prison has a higher percentage of Black and Latinx people in it, and thatâ€™s accounting for whether or not it already has a prison (so Iâ€™m not counting the population of prisoners in predicting that).\r\n\r\n[S]o this goes back to the heart of your question about the transmission of COVID between communities and prisons. If Black and brown people â€” Black people, especially â€” are over-represented in corrections officers, and most prisons are built in rural communities that have a higher number of Black folks, the workers â€” not the incarcerated people â€” [could spread the virus.]\r\n\r\nThe incarcerated people come from anywhere across the state, as most prisons are built by states. Another source of confusion is the belief that most prisons are privately owned, but roughly only 12â€“13% [â€¦] are privately owned; the vast majority of them are owned by state operators.\r\n\r\nSo, Texas, Georgia, and Florida have built the most prisons; and in those places, in rural Black communities, you have workers who are disproportionately Black coming and going out of these facilities.\r\n\r\nAnd because theyâ€™re essential employees [â€¦] who are disproportionately Black and Latinx [â€¦] theyâ€™re serving as vectors for transmission of the disease, more so than prisoners.\r\n\r\nBecause in prisons, we havenâ€™t decarcerated a whole lot of people under COVID. Weâ€™ve done more so through jails, which is a different system. In the U.S., about 1.6 million people are in prison, and about another 600,000 are in local jails, and most of the decarceration under COVID has occurred in [local county] jails.\r\n\r\nPrison guards [may spread the virus] in particular. I formed a team of researchers, and weâ€™re running analyses to see if this hypothesis holds true and if it will hold during the whole COVID crisis.\r\n\r\nBut places with prisons â€” Iâ€™ve already done the analysis on this â€” counties with prisons have higher rates of COVID than counties that donâ€™t [have prisons]. \r\n\r\nSo thatâ€™s the baseline descriptive, and now we have to look to see the number of cases per facility and worker.\r\n\r\nMNT: Do the type of employment contracts that these workers work under play a role as well? \r\n\r\nProf. John Eason: I think they would [â€¦] In a lot of states you have unionized corrections officers; and even if theyâ€™re not unionized, the level of pay for a corrections officer is going to be better compared to other jobs in the state. So, in a state like Arkansas, [â€¦] the pay for a corrections officer is going to be pretty good compared to most other salaries.\r\n\r\nSo, you may see variation; you might see differences not so much by employee status â€” like whether theyâ€™re temporary or permanent â€” but corrections officers tend to have a less fluid job than one might imagine. I think thereâ€™s higher fluidity in the private sector, [â€¦] so we could look to see if privately-owned prisons have a higher infection rate.\r\n\r\n[I]â€™m not sure if we have that level of data on the individual employees at this point, but that is something we could definitely investigate. I think that is an interesting question and Iâ€™d expect to see a higher rate of transmission in private facilities. \r\n\r\nMNT: Have you encountered any issues in terms of accessing COVID-19 data broken down by race or ethnicity in prisons?\r\n\r\nProf. John Eason: Jails would be a little different [but] with prisons, yes, thereâ€™s difficulty. I actually have another project locally here in Madison, Wisconsin, where in Dane County, the county sheriff has given me data on the jail, and itâ€™s looking at race. Thatâ€™s because theyâ€™re actively trying [to reduce their number of inmates; theyâ€™ve reduced the number of people incarcerated in their facilities by over 40%.\r\n\r\nEarly on, they saw that this is a public health crisis and they didnâ€™t want that on their hands, so theyâ€™ve done a lot â€” they can do a lot more, but theyâ€™ve done a lot to reduce the number of people in their jail. \r\n\r\nBut overall prisons? No, this data [for prisons] is very difficult to get and quite separately, if you go to immigrant detention facilities, itâ€™s impossible to get good data on that. We have multiple penal regimes in the U.S., [there are] multiple ways that we incarcerate people.\r\n\r\n[I] have another research project where Iâ€™m looking at [immigrant detention] and [â€¦] we lack data. Weâ€™re going to see a lot of death coming out of immigrant detentions because of [this lack of data].', '0000-00-00', );

